import React, { useState, useEffect, useMemo } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container, Box, Typography, TextField, Button,
  Checkbox, FormControlLabel, List, ListItem,
  Divider, Paper, Grid, Alert
} from '@mui/material';
import axios from 'axios';

function CourseList() {
  const navigate = useNavigate();
  const [courses, setCourses] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedCourses, setSelectedCourses] = useState([]);
  const [error, setError] = useState('');

  // Fetch courses from localStorage or backend
  useEffect(() => {
    const fetchCourses = async () => {
      try {
        // First try to get courses from localStorage
        const storedCourses = localStorage.getItem('courseList');
        if (storedCourses) {
          const parsedCourses = JSON.parse(storedCourses);
          console.log('Courses from localStorage:', parsedCourses);
          setCourses(parsedCourses);
          return;
        }

        // If not in localStorage, fetch from backend
        console.log('Fetching courses from backend...');
        const response = await axios.get('http://127.0.0.1:8000/course_list');
        console.log('Courses response from backend:', response.data);

        // Check if response.data is an array
        if (Array.isArray(response.data)) {
          setCourses(response.data);
        } else if (typeof response.data === 'string') {
          // If it's a string, split it by commas
          const coursesArray = response.data.split(',').map(course => course.trim());
          setCourses(coursesArray);
        } else if (response.data && response.data.error) {
          // If there's an error message
          setError(`Backend error: ${response.data.error}`);
          setCourses([]);
        } else {
          // Fallback to empty array
          console.error('Unexpected response format:', response.data);
          setError('Received unexpected data format from server.');
          setCourses([]);
        }
      } catch (error) {
        console.error('Error fetching courses:', error);
        setError('Failed to load courses. Please try again.');
        // Set some sample courses for testing
        setCourses([
          'CSC 110: Introduction to Computer Science',
          'CSC 115: Fundamentals of Programming II',
          'MATH 100: Calculus I',
          'MATH 101: Calculus II',
          'ENGR 110: Design and Communication I'
        ]);
      }
    };

    fetchCourses();
  }, []);

  const handleSearchChange = (e) => {
    setSearchQuery(e.target.value);
  };

  const handleCourseToggle = (course) => {
    setSelectedCourses(prev => {
      if (prev.includes(course)) {
        return prev.filter(c => c !== course);
      } else {
        return [...prev, course];
      }
    });
  };

  const handleSubmit = async () => {
    try {
      console.log('Submitting completed courses:', selectedCourses);

      // Store selected courses in localStorage
      localStorage.setItem('completedCourses', JSON.stringify(selectedCourses));

      // Send to backend
      await axios.post('http://127.0.0.1:8000/courses_completed', {
        courses: selectedCourses
      });

      console.log('Completed courses sent to backend');
      navigate('/chatbot');
    } catch (error) {
      console.error('Error submitting completed courses:', error);
      setError('Failed to submit courses. Please try again.');
    }
  };

  // Filter courses based on search query
  const filteredCourses = useMemo(() => {
    if (!searchQuery.trim()) {
      return courses;
    }

    const query = searchQuery.toLowerCase();
    return courses.filter(course => {
      if (typeof course === 'string') {
        return course.toLowerCase().includes(query);
      }
      return false;
    });
  }, [courses, searchQuery]);

  return (
    <Container maxWidth="md">
      <Box sx={{ my: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Select Completed Courses
        </Typography>

        <TextField
          fullWidth
          label="ðŸ” Search courses"
          value={searchQuery}
          onChange={handleSearchChange}
          margin="normal"
          variant="outlined"
        />

        <Paper sx={{ mt: 3, mb: 3, p: 2, maxHeight: '400px', overflow: 'auto' }}>
          {filteredCourses.length > 0 ? (
            <List>
              {filteredCourses.map((course, index) => (
                <React.Fragment key={course}>
                  <ListItem disablePadding>
                    <FormControlLabel
                      control={
                        <Checkbox
                          checked={selectedCourses.includes(course)}
                          onChange={() => handleCourseToggle(course)}
                        />
                      }
                      label={course}
                    />
                  </ListItem>
                  {index < filteredCourses.length - 1 && <Divider />}
                </React.Fragment>
              ))}
            </List>
          ) : (
            <Box sx={{ p: 2, textAlign: 'center' }}>
              {searchQuery ? (
                <Typography>No courses match your search criteria.</Typography>
              ) : (
                <Typography>No courses available. Please go back and select a major.</Typography>
              )}
            </Box>
          )}
        </Paper>

        <Typography variant="h6" gutterBottom>
          Your Selected Courses:
        </Typography>

        {selectedCourses.length > 0 ? (
          <Paper sx={{ p: 2, mb: 3, bgcolor: 'success.light' }}>
            <List>
              {selectedCourses.map(course => (
                <ListItem key={course}>
                  <Typography>{course}</Typography>
                </ListItem>
              ))}
            </List>
          </Paper>
        ) : (
          <Alert severity="info" sx={{ mb: 3 }}>
            No courses selected yet.
          </Alert>
        )}

        {error && (
          <Alert severity="error" sx={{ mb: 3 }}>
            {error}
          </Alert>
        )}

        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Button
              fullWidth
              variant="outlined"
              onClick={() => navigate('/user-preferences')}
            >
              Back to User Details
            </Button>
          </Grid>
          <Grid item xs={6}>
            <Button
              fullWidth
              variant="contained"
              color="primary"
              onClick={handleSubmit}
            >
              Start Planning
            </Button>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}

export default CourseList;
